import React from "react";
import styled from "styled-components";

const Footer = (props) => {
  const Container = styled.div`
    border: 1px solid black;
    margin: 0 1rem;
    height: 3rem;
    display: grid;
    grid-template-columns: 25% 25% 25% 25%;
  `;
  return (
    <>
      <Container></Container>
    </>
  );
};

export default Footer;
